import React, { Component } from "react";
import image from "../img/item-2.png";
class Product extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: JSON.parse(this.props.productName),
    };
  }
  render() {
    console.log(this.state.data);
    return (
      <div className="product-container">
        <img src={this.props.productName.image} />
        <div className="product-descripiton">
          <h6>{this.props.productName.name}</h6>
          <h6 className="price">24$</h6>
        </div>
      </div>
    );
  }
}

export default Product;
